import Searchbar from "../Searchbar/SearchBar";
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <div>
      <nav>
        <button>
          <Link to="/home">Home</Link>
        </button>
        <button>
          <Link to="/about">About</Link>
        </button>
        <button>
          <Link to="/favorites">Favorites</Link>
        </button>
        <button>
          <Link to="/">Logout</Link>
        </button>
      </nav>
    </div>
  );
};

export default Nav;
